import React from "react";
import Home from './pages/home/Home';
import Profile from './pages/profile/Profile';
import { 
  BrowserRouter as Router,
  Routes,
  Route,
  Link
 } from 'react-router-dom';

const App = () => {
  return (
    <div>
      <Router>
        <Routes>
          <Route exact path="/profile" element={<Home />} />
        <Profile/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
